// Get the HTML element
const element = document.querySelector('html');

// Set the lang attribute 
element.setAttribute('lang', 'en');

//To resolve Empty Headings
const emptyHeadings = document.querySelectorAll('h1:empty, h2:empty, h3:empty, h4:empty, h5:empty, h6:empty');
if(emptyHeadings.length>0){
for (const heading of emptyHeadings) {
  heading.remove();
}
}

//Remove Multiple IDs on the Home page 
const idsToRemove = ['smiles-are-the-brightest-fluorescent-materials-ever-made'];

for (const id of idsToRemove) {
  const elementToRemove = document.querySelector(`[id="${id}"]`); 
  elementToRemove.parentNode.removeChild(elementToRemove);
}

</script>", "id": "a03d2913-db28-445b-b4b7-a127a4596ee1"}]
